import './index.css';
import React from 'react';
import ReactDOM from 'react-dom';

const BookList=()=>{
return(
<div className="booklist">
	<Book/>
</div>
)
}

const title = "A man called over";
const author = "Hello";
const imgPath ="https://www.amazon.com/sljsakoxvfjav";
const Book=()=>{

return(
<div className='book'>
	<p>{title}</p>
	<img src={imgPath} alt="not found" />
	<i style={{fontSize:'0.75rem', marginTop:'0.25rem',backgroundColor:'white'}}>{author}</i>
	{5+6-4}
	{ 4*5 === 20? 'TRUE': 'FALSE' }
	{author.toUpperCase()}
</div>
)
}
